import React, { memo } from 'react';
import PropTypes from 'prop-types';

export const MenueHeader = memo(({ headerText }) => {

  return <header>
    <h2>{headerText}</h2>
  </header>;
});

MenueHeader.defaultProps = {
  headerText: 'The Tool',
};

MenueHeader.propTypes = {
  headerText: PropTypes.string,
};
